window.bookSummaryJSON = "<p>Ty Wilcox has leveled up. Unfortunately, so have his enemies.</p> <p>Ty is no longer the loser he had once been. He’s gone from zero to superhero, all thanks to a device on his wrist that brings a hidden power out into the light.<br> &nbsp;</p> <p>Before Ty came along, only a few of the devices existed. But a secretive villain has learned how to make them, and one of New Lincoln’s most dangerous crime lords has a supply of them as well.<br> &nbsp;</p> <p>And now, super-powered villains even stronger than Ty are stepping out of the dark.<br> &nbsp;</p> <p>The balance of power is changing, and not for the better.<br> &nbsp;</p> <p>Does Ty have the power to stop it, even with his growing team of super heroines at his side?</p>"; 
